const t=JSON.parse('{"key":"v-25f223f8","path":"/poems/book2/6/0.html","title":"《歌谷》研讨稿 1","lang":"zh-CN","frontmatter":{"icon":"pen-to-square","date":"2021-04-15T00:00:00.000Z","category":["秋水集·卷二"],"order":1,"breadcrumb":false,"author":"张理琦","description":"《歌谷》研讨稿 1 张栩越对于铁侵的成因给出了一种新的解释。在弦理论中，宇宙犹如一张巨大的膜，而物质粒子则是膜上振动的弦。这些弦有些是闭合的，有些则是非闭合的。 试想两张膜接近的时候，两张膜产生交叉，此时膜A上的弦就有可能“跃迁”到膜B上，实现物质的出现和消失。这个理论有些近似于平行宇宙，但更为具体。 另一个难点在于，如何使小人物接触高层群体。在商讨中，张栩越提出，可以设置为先由天文爱好者观测到地球外的铁侵现象。 事实上，归根结底，我对铁侵最后的结局仍存质疑。我们要表现的究竟是什么？结局是否有强行收束，过分突兀之嫌？现在的情况无异于《银河英雄传说》中结尾有意将莱茵哈鲁特写死，显得非常突兀。","head":[["meta",{"property":"og:url","content":"https://blog.ricklos.top/poems/book2/6/0.html"}],["meta",{"property":"og:site_name","content":"昔望"}],["meta",{"property":"og:title","content":"《歌谷》研讨稿 1"}],["meta",{"property":"og:description","content":"《歌谷》研讨稿 1 张栩越对于铁侵的成因给出了一种新的解释。在弦理论中，宇宙犹如一张巨大的膜，而物质粒子则是膜上振动的弦。这些弦有些是闭合的，有些则是非闭合的。 试想两张膜接近的时候，两张膜产生交叉，此时膜A上的弦就有可能“跃迁”到膜B上，实现物质的出现和消失。这个理论有些近似于平行宇宙，但更为具体。 另一个难点在于，如何使小人物接触高层群体。在商讨中，张栩越提出，可以设置为先由天文爱好者观测到地球外的铁侵现象。 事实上，归根结底，我对铁侵最后的结局仍存质疑。我们要表现的究竟是什么？结局是否有强行收束，过分突兀之嫌？现在的情况无异于《银河英雄传说》中结尾有意将莱茵哈鲁特写死，显得非常突兀。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"article:author","content":"张理琦"}],["meta",{"property":"article:published_time","content":"2021-04-15T00:00:00.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"《歌谷》研讨稿 1\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2021-04-15T00:00:00.000Z\\",\\"dateModified\\":null,\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"张理琦\\"}]}"]]},"headers":[],"git":{},"readingTime":{"minutes":1.48,"words":445},"filePathRelative":"poems/book2/6/0.md","localizedDate":"2021年4月15日","excerpt":"<h1> 《歌谷》研讨稿 1</h1>\\n<p>张栩越对于铁侵的成因给出了一种新的解释。在弦理论中，宇宙犹如一张巨大的膜，而物质粒子则是膜上振动的弦。这些弦有些是闭合的，有些则是非闭合的。</p>\\n<p>试想两张膜接近的时候，两张膜产生交叉，此时膜A上的弦就有可能“跃迁”到膜B上，实现物质的出现和消失。这个理论有些近似于平行宇宙，但更为具体。</p>\\n<p>另一个难点在于，如何使小人物接触高层群体。在商讨中，张栩越提出，可以设置为先由天文爱好者观测到地球外的铁侵现象。</p>\\n<p>事实上，归根结底，我对铁侵最后的结局仍存质疑。我们要表现的究竟是什么？结局是否有强行收束，过分突兀之嫌？现在的情况无异于《银河英雄传说》中结尾有意将莱茵哈鲁特写死，显得非常突兀。</p>","autoDesc":true}');export{t as data};
